// import React , {useState} from "react";
import $ from "jquery";

function pulsar( algo ) {
	var algo = $("input").val();
	// const algo = "HEHEEEEEEEEEEE";
	console.log( algo );
	this.setState( algo )
}

export {
	pulsar
}
